import React, { Component } from 'react';

class Bead extends Component {

  render() {

    return (
      <div 
        className="object"
        style={{
          left: this.props.x, 
          top: this.props.y,
          width: 10,
          height: 10,
          borderRadius: 100,
          backgroundColor: "#000000",
          position: "relative"
        }}
      >

      </div>
    )
  }
}

export default Bead;
